import React, { useEffect, useState } from 'react';
import api from '../api/api';

function Standings() {
  const [table, setTable] = useState([]);
  useEffect(() => {
    api.get('/standings').then(res => setTable(res.data));
  }, []);
  return (
    <div>
      <h1 className="text-xl p-4">Standings</h1>
      <table className="min-w-full text-left">
        <thead><tr><th>Pos</th><th>Team</th><th>Points</th></tr></thead>
        <tbody>
          {table.map(t => (
            <tr key={t.position}>
              <td>{t.position}</td><td>{t.team}</td><td>{t.points}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Standings;
